    public static Address fakeAddress() {

        String[] roads = new String[]{"St", "Road", "Rd", "RD", "Rd.", "Street", "STREET", "Way", "Blvd", "Parkway", "Trail"};
        Random random = new Random();
        Address address = getComanyAddress();
        address.setFirstName(randomProperFirstName());
        address.setLastName(randomLastName());
        address.setStreetName(generateName() + " " + randomTitle(roads));
        address.setStreetNumber(Integer.toString(random.nextInt(9000)));
        address.setZip(Integer.toString(random.nextInt(90000)));
        return address;
    }

    public static String generateName() {
        String[] Beginning = {"Kr", "Ca", "Ra", "Mrok", "Cru",
                "Ray", "Bre", "Zed", "Drak", "Mor", "Jag", "Mer", "Jar", "Mjol",
                "Zork", "Mad", "Cry", "Zur", "Creo", "Azak", "Azur", "Rei", "Cro",
                "Mar", "Luk"};
        String[] Middle = {"air", "ir", "mi", "sor", "mee", "clo",
                "red", "cra", "ark", "arc", "miri", "lori", "cres", "mur", "zer",
                "marac", "zoir", "slamar", "salmar", "urak"};
        String[] End = {"d", "ed", "ark", "arc", "es", "er", "der",
                "tron", "med", "ure", "zur", "cred", "mur"};

        Random rand = new Random();

        return Beginning[rand.nextInt(Beginning.length)] +
                Middle[rand.nextInt(Middle.length)] +
                End[rand.nextInt(End.length)];

    }

